def _unstack_multiple(data, clocs, fill_value=None):
    if len(clocs) == 0:
        return data

    index = data.index

    is_hierarchical = isinstance(index, MultiIndex)

    if not is_hierarchical:
        result = data.unstack(clocs, fill_value=fill_value)
    else:
        unstacked = data.unstack(clocs, fill_value=fill_value)

        # Reconstruct the MultiIndex with new levels and names
        new_levels = list(index.levels) + [unstacked.index]
        new_names = list(index.names) + ['__placeholder__']

        # Construct the new MultiIndex
        new_index = MultiIndex(levels=new_levels, codes=list(index.codes) + [unstacked.codes], names=new_names, verify_integrity=False)

        if isinstance(data, Series):
            result = Series(data=unstacked.values, index=new_index)
        else:
            result = DataFrame(data=unstacked.values, index=new_index, columns=unstacked.columns)

    return result
